import React, { Component } from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import UnrecognizedTable from './unrecognizedTable'

const Axios = require('axios')

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  chart: {
      width: '125%',
      height: '325px'
  },
  heatmap: {
      padding: theme.spacing(2),
      width: '75%',
      marginLeft: '25%',
      height: '310px'
  },
  timePlot: {
    marginTop: '30px',
    padding: theme.spacing(2),
    width: '75%',
    marginLeft: '25%',
    height: '310px'
  }
}));

class MyGrid extends Component {

  state = {
    dataList: []
  }

  refresh = async() => {
    let data = await Axios.get('/api/lpr/getUnrecognizedData')
    console.log(data)
    this.setState({dataList: data.data})
  }

  componentDidMount(){
    this.refresh()
  }

  render(){
  const classes = {
    root: {
      flexGrow: 1,
    },
    paper: {

      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
    chart: {
        width: '125%',
        height: '325px'
    },
    heatmap: {

        width: '75%',
        marginLeft: '25%',
        height: '310px'
    },
    timePlot: {
      marginTop: '30px',

      width: '75%',
      marginLeft: '25%',
      height: '310px'
    }
  };

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={6}>
          <Paper className={classes.chart}>
              <UnrecognizedTable dataList = {this.state.dataList}/>
          </Paper>
        </Grid>
        <Grid item xs={6}>
          <Paper className={classes.heatmap} style={{backgroundColor: '#E5E5E5'}}>
              Chart showing the areas with the most unrecognized plate
          </Paper>
          <Paper className={classes.timePlot} style={{backgroundColor: '#E5E5E5'}}>
              Chart showing activity over time
          </Paper>
        </Grid>
      </Grid>
    </div>
  )};
}

export default withStyles(useStyles)(MyGrid)
